import mutations from './mutations.js';
import actions from './actions.js';
import getters from './getters.js';

export default {
    namespaced: true,
    state() {
        return {
            greenhouseUser:
                {
                  accessToken: {key:'the quick brown fox jumped over the lazy dog', expires: '02/04/2025'},
                  firstName: 'Alexander',
                  lastName: 'Haig-Thomas',
                  role: ['technical', 'gardener', 'administration']
                }

        };
    },
    mutations,
    actions,
    getters
};
